import React, { useState } from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
// import FormControlLabel from '@mui/material/FormControlLabel';
// import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
// import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import ForumOutlinedIcon from '@mui/icons-material/ForumOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import axios from '../axios'
import '../components/background/bg.css'
import { baseUrl } from '../url';
import { useNavigate } from 'react-router-dom'
import { Backdrop, CircularProgress } from '@mui/material';
// import { UserContext } from '../Context/Context';
import './style.css'

function Copyright(props) {


  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
      {'Copyright Â© '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const theme = createTheme();


export default function SignIn({ socket }) {

  const navigate = useNavigate()
  const [genter, setGenter] = useState('')
  const [borderF, setBorderF] = useState(0)
  const [borderM, setBorderM] = useState(0)
  const [url, setUrl] = useState('')
  const [message, setMessage] = useState('')
  const [open, setOpen] = useState(false)
  const male = 'https://www.shutterstock.com/image-vector/face-expression-handsome-young-man-260nw-1751161418.jpg'
  const female = 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRxMBXqUmPKxhTg1I3_gzp6Nuom9tFjq7bOqe3TNgiR&s'
  // const { setUserId } = useContext(UserContext)

  const handleClose = () => {
    setOpen(false);
  };

  const handleLogin = (event) => {

    event.preventDefault();
    // setOpen(!open);
    const data = new FormData(event.currentTarget);
    // console.log(data.get('name'));
    // console.log(genter);
    const loginData = {
      Name: data.get('name'),
      Genter: genter,
      imageURL: url
    }
    console.log(loginData);

    axios.post(`${baseUrl}/login`, loginData, { withCredentials: true }).then((res) => {
      console.log(res.data.msg);
      if (res.data.msg) setMessage(res.data.msg)
      if (res.data.Name) navigate('/chatpage')
      // if (!response.data.error) {
      // setEmailError(false)
      // setPasswordError(false)
      //   if (response.data.loginGranted) {
      //     console.log(response.data)
      //     axios.get(`${baseUrl}/auth`, { withCredentials: true }).then((response) => {
      //       setUserId(response.data.user._id)
      //       socket.emit('newUser', { userName: response.data.user.firstName, userId: response.data.user._id, imageUrl: response.data.user.imageUrl });
      //       navigate('/chatpage')
      //     })
      //   }
      // } else {
      //   if (response.data.error === "email") {
      //     setOpen(false);
      //     setEmailError(true)
      //   } else {
      //     setOpen(false);
      //     setPasswordError(true)
      //     setEmailError(false)
      //   }

      // }
    })
  };


  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
              <ForumOutlinedIcon />
            </Avatar>
            <Typography sx={{ component: "h1", variant: "h5", color: "secondary.main" }}>CHIT CHAT</Typography>
          </Box>
          <Box component="form" onSubmit={handleLogin} noValidate sx={{ mt: 1 }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="name"
              label="User Name"
              name="name"
              autoComplete="name"
              autoFocus
              onChange={() => setMessage('')}
            />
            {message && <Typography sx={{ color: 'red' }}>{message}</Typography>}
            <Box sx={{
              display: 'flex'
            }}>
              <Box sx={{
                width: '8rem',
                height: '7rem',
                bgcolor: 'red'
              }}
                border={borderF}
                // className='femalebg'
                onClick={() => {
                  setGenter('female')
                  setUrl('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRxMBXqUmPKxhTg1I3_gzp6Nuom9tFjq7bOqe3TNgiR&s')
                  setBorderF(2)
                  setBorderM(0)
                }}
              >
                <img src={female} alt='img' width={350} height={300}></img>
              </Box>
              <Box sx={{
                width: '8rem',
                height: '7rem',
                bgcolor: 'red',
              }}
                border={borderM}
                // className='malebg'
                onClick={() => {
                  setGenter('male')
                  setUrl('https://www.shutterstock.com/image-vector/face-expression-handsome-young-man-260nw-1751161418.jpg')
                  setBorderF(0)
                  setBorderM(2)
                }}
              >
                <img src={male} alt='img' width={350} height={300}></img>
              </Box>
            </Box>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              LOGIN
            </Button>
          </Box>
        </Box>
        <Backdrop
          sx={{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 1 }}
          open={open}
          onClick={handleClose}
        >
          <CircularProgress color="inherit" />
        </Backdrop>
        <Copyright sx={{ mt: 8, mb: 4 }} />
      </Container>
    </ThemeProvider>
  );
}
